export const InterviewPage = () => {
  const navigate = useNavigate();
  const [globalFilterValue, setGlobalFilterValue] = useState("");
  const [showResult, setShowResult] = useState<boolean>(false);
  const [selectedRowData, setSelectedRowData] = useState<DataTableValue | null>(null);
  const [filters, setFilters] = useState({
    global: { value: null, matchMode: FilterMatchMode.CONTAINS },
    id: { value: null, matchMode: FilterMatchMode.STARTS_WITH },
    position: { value: null, matchMode: FilterMatchMode.CONTAINS },
    type: { value: null, matchMode: FilterMatchMode.EQUALS },
    createdAt: { value: null, matchMode: FilterMatchMode.DATE_IS },
    totalScore: { value: null, matchMode: FilterMatchMode.EQUALS },
  });

  const onGlobalFilterChange = (e) => {
    const value = e.target.value;
    let _filters = { ...filters };

    _filters["global"].value = value;

    setFilters(_filters);
    setGlobalFilterValue(value);
  };

  const dateBodyTemplate = (rowData) => {
    return (
      <div className="pointer-events-none">
        <span className="text-[#8E8E93] font-medium text-base">{rowData.createdAt}</span>
      </div>
    );
  };

  const positionBodyTemplate = (rowData) => {
    return (
      <div className="pointer-events-none">
        <span className="text-[#191919] font-medium text-base">{rowData.position}</span>
      </div>
    );
  };

  const ColumnItems = [
    {
      field: "createdAt",
      filterField: "createdAt",
      header: "Date",
      width: "15%",
      body: dateBodyTemplate,
      filter: false,
    },
    {
      field: "position",
      filterField: "position",
      header: "Position",
      width: "40%",
      body: positionBodyTemplate,
      filter: true,
    },
    {
      field: "interviewer",
      filterField: "interviewer",
      header: "Interviewer",
      width: "40%",
      body: (rowData) => {
        return (
          <div className="pointer-events-none">
            <span className="text-[#8E8E93] font-medium text-base">
              {rowData.interviewer == "andrew" ? "Andrew - CEO" : "Lily - HR Manager"}
            </span>
          </div>
        );
      },
      filter: true,
    },
    {
      header: "Action",
      width: "20%",
      body: (rowData) => {
        return (
          <button
            className={cn(
              "flex items-center justify-center w-[160px] h-full bg-gray-200 rounded-lg py-2",
              !rowData.content || Object.keys(rowData.content).length === 0
                ? "cursor-not-allowed text-gray-400"
                : "text-gray-800",
            )}
            disabled={!rowData.content}
            onClick={() => {
              if (!rowData.content || Object.keys(rowData.content).length === 0) return;
              setSelectedRowData(rowData);
              setShowResult(true);
            }}
          >
            Review
          </button>
        );
      },
    },
  ];

  const [interviews, setInterviews] = useState<boolean | undefined>(false);
  const { result, loading: interviewLoading, error } = useFindInterviewsByUserId();
  const { deleteInterview, loading: deleteLoading } = useDeleteInterview();
  const [dataTable, setDataTable] = useState([]);

  // Format data
  const formatDate = (date) => {
    const day = String(date.getDate()).padStart(2, "0");
    const month = String(date.getMonth() + 1).padStart(2, "0"); // Months are zero-based
    const year = date.getFullYear();

    return `${day}/${month}/${year}`;
  };

  useEffect(() => {
    if (result != undefined || result != null) {
      if (result.length > 0) {
        const formattedData = result.map((item) => ({
          ...item,

          createdAt: formatDate(item.createdAt),
        }));
        setDataTable(formattedData as []);
        setInterviews(true);
      } else {
        setInterviews(false);
      }
    }
  }, [result]);

  const handleClick = () => {
    navigate("/dashboard/interview-information");
  };

  const header = renderHeader(globalFilterValue, onGlobalFilterChange, handleClick);

  return (
    <div className="h-full w-full p-0 pt-4 flex flex-col bg-[#f2f2f7]">
      {showResult && (
        <InterviewReview
          data={selectedRowData as any}
          isOpen={showResult}
          setIsOpen={setShowResult}
        />
      )}
      <ConfirmDialog
        pt={{
          content: { style: { display: "flex", alignItems: "center" } },
          acceptButton: {
            root: { className: "bg-[#FF3B30] hover:bg-[#DE3D34] border-none" },
          },
        }}
      />
      <div className="flex justify-between items-center">
        <span className="text-2xl font-bold">AI Mock Interview</span>
      </div>
      <div className="flex flex-row gap-x-4 justify-start items-start pt-4">
        <div className="flex-grow h-auto max-w-[1200px]" id="ai-interview-management">
          <div className="">
            <DataTable
              rows={8}
              loading={interviewLoading}
              dataKey="id"
              filterIcon={() => {
                return <i className="pi pi-sort-down-fill"></i>;
              }}
              filters={filters}
              globalFilterFields={["id", "position", "type", "createdDate", "totalScore"]}
              header={header}
              value={dataTable}
              emptyMessage={renderEmptyMessage(handleClick)}
              selectionMode={"single"}
              selection={selectedRowData}
              onSelectionChange={(e) => {
                if (e.value != null) {
                  setSelectedRowData(e.value);
                }
              }}
              paginator={interviews ? true : false}
              pt={{
                root: { className: "flex flex-col gap-y-4 pt-4" },
                thead: { className: "bg-[#E5E5EA]" },
                header: { style: { background: "transparent", padding: 0, border: "none" } },
                wrapper: { className: "rounded-t-xl" },
                table: { className: `w-full overflow-y-hidden bg-white` },
                bodyRow: { className: `cursor-pointer` },
              }}
            >
              {ColumnItems.map((item, i) => (
                <Column
                  field={item.field}
                  filterField={item.filterField}
                  header={item.header}
                  style={{ width: `${item.width}` }}
                  body={item.body ? item.body : null}
                  filter={item.filter}
                  showFilterMatchModes={false}
                  pt={{
                    headerContent: { className: "flex items-start justify-between" },
                    headerCell: {
                      style: {
                        background: "#E5E5EA",
                        borderBottom: 1,
                        borderBottomColor: "#E5E5EA",
                      },
                    },
                  }}
                />
              ))}
            </DataTable>
          </div>
        </div>
        <div
          className="pt-4 flex-grow-0 w-[300px] h-auto bg-white rounded-2xl hidden md:flex"
          id="ai-interview-information"
        >
          <img
            src="/ai-interview-vertical-banner.png"
            alt="ai-interview-vertical-banner"
            className="w-[300px] h-auto flex"
          />
        </div>
      </div>
    </div>
  );
};
